 *     <motion.li variants={item} />
 *     <motion.li variants={item} />
 *   </motion.ol>
 * )
 * ```
 *
 * @public
 */

/**
 * The direction in which to stagger children.
 *
 * A value of `1` staggers from the first to the last while `-1` staggers from the last to the first.
 *
 * @library
 * ```jsx
 * const container = {
 *   hidden: { opacity: 0 },
 *   show: {
 *     opacity: 1,
 *     transition: {
 *       delayChildren: 0.5,
 *       staggerDirection: -1
 *     }
 *   }
 * }
 *
 * const item = {
 *   hidden: { opacity: 0 },
 *   show: { opacity: 1 }
 * }
 *
 * return (
 *   <Frame
 *     variants={container}
 *     initial="hidden"
 *     animate="show"
 *   >
 *     <Frame variants={item} size={50} />
 *     <Frame variants={item} size={50} />
 *   </Frame>
 * )
 * ```
 *
 * @motion
 * ```jsx
 * const container = {
 *   hidden: { opacity: 0 },
